import React from "react";
import ButtonFooter from "./ButtonFooter";
import '../../index.css'

const Footer = ({setTodo, setFilter, filter}) => {
    return (
        <footer className='footer'>
            <ButtonFooter title='Clear' filter={filter}  onClick={() => setTodo([])}/>
            <ButtonFooter title='All' filter={filter} filterExpValue={'all'} onClick={() => setFilter('all')}/>
            <ButtonFooter title='Complited' filter={filter} filterExpValue={'finish'} onClick={() => setFilter('finish')}/>
            <ButtonFooter title='Незаконченные дела' filter={filter} filterExpValue={'active'} onClick={() => setFilter('active')}/>
        </footer>
    )
}

export default Footer;
